import React, { Component } from 'react'
import rocketLogo from '../src/img/rocket-02.png';
const Footer = ({onRouteChange}) =>  {
    return (
      <div className="footer">
        <ul className="nav">
            <li className="nav__item"><a href="#" onClick={() => onRouteChange('Fleece')}className="nav__link btn">Home</a></li>
            <li className="nav__item"><a href="#" className="nav__link btn">Contact</a></li>
            <li className="nav__item"><a href="#" className="nav__link btn">Send Feedback</a></li>
            <li className="nav__item"><a href="#" className="nav__link btn">Our Story</a></li>
        </ul>
        <div className="footer__img">
            <img className="__logo" src={rocketLogo} alt="rocket logo"/>
        </div>
      </div>
    )
  }

export default Footer;
